const mongoose = require('mongoose');

const UserSchema = new mongoose.Schema({
    createdAt:{
        type:Date,
        default:Date.now()
    },
    email:{
        type:String,
        required:true
    },
    emailVerified:{
        type:Boolean,
        default:false
    },
    password:{
        type:String,
        required:true
    },
    updatedAt:{
        type:Date,
        default:Date.now(),
    },
    first_name:{
        type:String,
        required:true
    },
    last_name:{
        type:String,
        required:true
    }
})
export default UserSchema;
